import React from 'react';
import { Table } from "react-bootstrap";

function TriangleDimensions () {
    return (   
        <Table bordered>
            <thead>
                <tr>
                    <th colspan="2">
                        Triangle Dimensions
                    </th>
                </tr>
                <tr>
                    <th>
                        Side/Angle
                    </th>
                    <th>
                        Measurement
                    </th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>A</td>
                    <td>3</td>
                </tr>
            </tbody>
        </Table>
    );
};

export default TriangleDimensions;
